/** @format */

import React, { Fragment, useState } from "react";
import {
  Box,
  Typography,
  Grid,
  TextField,
  Table,
  TableContainer,
  TableHead,
  TableRow,
  TableCell,
  Checkbox,
} from "@mui/material";

const CreateInvoice = () => {
  const [invoiceData, setInvoiceData] = useState({
    matter: "",
    contact: "",
    billable: false,
    date_range: "",
    create_date: "",
    due_date: "",
    template: "",
    invoice_no: "",
    discount: "",
    submit: "",
  });

  const {
    matter,
    contact,
    billable,
    date_range,
    create_date,
    due_date,
    template,
    invoice_no,
    discount,
    submit,
  } = invoiceData;

  const [invoice, setInvoice] = useState(null);
  // useEffect(() => {
  //   const config = {
  //     headers: {
  //       "Content-Type": "application/json",
  //       Accept: "application/json",
  //     },
  //   };
  //   const res = axios.get(
  //     `${process.env.REACT_APP_API_URL}/api/category`,
  //     config,
  //   );
  //   setInvoice(res.data);
  // }, []);
  const onChange = (e) =>
    setInvoiceData({ ...invoiceData, [e.target.name]: e.target.value });

  const onSubmit = (e) => {
    e.preventDefault();
  };
  return (
    <Fragment>
      <Box
        component="form"
        Validate
        sx={{
          "& .MuiTextField-root": { m: 1 },
        }}
        onSubmit={(e) => onSubmit(e)}
      >
        <Typography component="h3" variant="h4">
          Create New Matter
        </Typography>
        <Grid container spacing={2}>
          <Grid item xs={12}>
            <TextField
              margin="normal"
              variant="standard"
              name="contact"
              label="contact"
              type="text"
              value="contact"
              onChange={(e) => onChange(e)}
              id="contact"
              autoComplete="contact"
            />
            <TextField
              margin="normal"
              variant="standard"
              name="matter_number"
              label="matter_number"
              type="text"
              value="matter_number"
              onChange={(e) => onChange(e)}
              id="matter_number"
              autoComplete="matter_number"
              disabled
            />
          </Grid>
          <Grid item xs={12}>
            <TableContainer>
              <Table>
                <TableHead>
                  <TableRow>
                    <TableCell>Sub-Category</TableCell>
                    <TableCell>Description</TableCell>
                    <TableCell>Date</TableCell>
                    <TableCell>Hours</TableCell>
                    <TableCell>Rate</TableCell>
                    <TableCell>Sub</TableCell>
                    <TableCell>Tax</TableCell>
                    <TableCell>int</TableCell>
                    <TableCell>Disc.</TableCell>
                    <TableCell>Total</TableCell>
                    <TableCell>Biller</TableCell>
                  </TableRow>
                  {invoice?.map((invoice) => {
                    <TableRow id={invoice.id}>
                      <TableCell>
                        <Checkbox />
                      </TableCell>
                      <TableCell>{invoice.sub_cat}</TableCell>
                      <TableCell>{invoice.discription}</TableCell>
                      <TableCell>{invoice.date}</TableCell>
                      <TableCell>{invoice.hours}</TableCell>
                      <TableCell>{invoice.rate}</TableCell>
                      <TableCell>{invoice.sub}</TableCell>
                      <TableCell>{invoice.tax}</TableCell>
                      <TableCell>{invoice.int}</TableCell>
                      <TableCell>{invoice.dics}</TableCell>
                      <TableCell>{invoice.total}</TableCell>
                      <TableCell>{invoice.biller}</TableCell>
                    </TableRow>;
                  })}
                </TableHead>
              </Table>
            </TableContainer>
          </Grid>
          <Grid item></Grid>
        </Grid>
      </Box>
    </Fragment>
  );
};

export default CreateInvoice;
